package uz.music.components;

import org.springframework.stereotype.Component;

import java.util.ArrayList;
import java.util.List;
import java.util.Random;

@Component
public class ClassicalMusic implements Music {

    public List<Details> album(){
        List<Details> album=new ArrayList<>();
        album.add(new Details("Sherali Jo'rayev - 18 da edim o'shanda","https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSRUF6PJ1MUCjPM-IFoyCumg7m45z88_nthSg&usqp=CAU"));
        album.add(new Details("G'iyos Boytoyev - tegirmon","data:image/jpeg;base64,"));
        album.add(new Details("Xurshid Rasulov - Sevsang aldama","data:image/jpeg;base64,"));
    return album;
    }
    @Override
    public Details music() {
        Random random=new Random();
        return album().get(random.nextInt(3));
    }
}
